      let showName = function(event) {
          event.target.className.substring(0,4) == 'name' ? (function() {
              event.target.style.color = 'white';
              event.target.style.mixBlendMode = 'darken';
          })() : console.log(event.target.className.substr(0,4));
      };
      document.querySelector('.container').addEventListener('mouseover', showName);
      document.querySelector('.container').addEventListener('touchmove', function(event) {

          event.target.className.substring(0,4) == 'name' ? (function() {
              // console.log(event);
              document.elementFromPoint(event.changedTouches[0].clientX, event.changedTouches[0].clientY).style.color = 'white';
              document.elementFromPoint(event.changedTouches[0].clientX, event.changedTouches[0].clientY).style.mixBlendMode = 'darken';
